import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from './components/navbar';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Router>
          <PageRoot matches={matches}>
            <div>
              {routes.map((route, index) => {
                return (
                  <Route
                    exact
                    key={index}
                    path={route.path}
                    element={<route.component />}
                  ></Route>
                );
              })}
            </div>
          </PageRoot>
        </Router>
    </div>
  );
}

export default App;
